@ravipesala 
I think another method findLastDataBlock of class BTreeDataRefNodeFinder still has some issue.
I will try to modify it.

Because the byte array length of each non-dictionary value in default end key is 1, 
if the byte array length of  some non-dictionary value in index is 2, and the first byte is same with default end key,
now we will lost this block.

for example:
non-dictionary default end key(one byte): 0xFF
the start key of some block in btree index: 0xFF00
after compare method,  it will lost this block.
